  Trail.create!(trail_forks_id: 42899, name: 'Bowmont Singletrack', description: 'This is a route that follows some of the popular singletrack in Bowmont Park. Following the banks of the Bow River you will be treated to some decent undulating inner city dirt with a few short punchy climbs. This route can be linked up with [L=https://www.trailforks.com/trails/sideshow-bob/]Sideshow Bob[/L] directly to the SE and Twelve Mile Coulee to the NW via a couple km of new paved pathway and tunnels under Stoney Trail. Generally dries out fairly quickly after rain as it is exposed river bank. During winter it can be good fatbiking conditions, and very often rideable on a regular MTB with studs due to walkers and Chinooks. 

Be prepared to yield to dog walkers and oncoming bike traffic, especially on blind corners. 

